import "./NavButtons.css";
import NavButton from "./NavButton";

const NavButtons = () => {
  return (
    <div className="nav-buttons">
      <NavButton text="about me" />
      <NavButton text="character list" />
      <NavButton text="todo" />
      <NavButton text="contact" />
    </div>
  );
};

export default NavButtons;
